import React, { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
function BookingCard({ title, price, description, photos }) {
    const [details, setDetails] = useState(false);
    const handleClick = () => {
        setDetails(true);
    }
    const handleClose = () => {
        setDetails(false);
    }
    return (
        <div>
            <Card style={{ width: '18rem' }}>
                <Card.Img variant="top" src={photos[0]?.url || '/images/flinder.jpeg'} alt={photos[0]?.caption || 'Image'} />
                <Card.Body>
                    <Card.Title>{title}</Card.Title>
                    <Card.Text>
                        {description}
                        <br />
                        <strong>Price: </strong>${price}
                    </Card.Text>
                    <Button variant="primary" onClick={handleClick}>View Details</Button>

                </Card.Body>

            </Card>
            {details &&
                <div>
                    <Card className="detailCard" style={{ width: '18rem' }}>
                        <Card.Img variant="top" src={photos[0]?.url || '/images/flinder.jpeg'} alt={photos[0]?.caption || 'Image'} />
                        <Card.Body>
                            <Card.Title>{title}</Card.Title>
                            <Card.Text>
                                {description}
                                <br />
                                <strong>Price: </strong>${price}
                            </Card.Text>
                            <Button variant="primary" onClick={handleClose}>Close Details</Button>

                        </Card.Body>

                    </Card>
                </div>
            }
        </div>
    );
}

export default BookingCard;
